y="63">いい土地が見つかるの？</tspan></text><text class="cls-13" transform="translate(36.39 768.57)">これらは住宅購入やリフォーム時に決めなければならないことです<tspan class="cls-14" x="540" y="0">。</tspan><tspan x="0" y="29.23">そこで</tspan><tspan class="cls-15"><tspan x="0" y="110.27">ちょっとした仕組みを知るだけで「</tspan><tspan class="cls-5" x="384" y="110.27">得</tspan><tspan x="408" y="110.27">」をすることがあります</tspan><tspan x="0" y="148.27">ちょっとした知識を得るだけで「</tspan><tspan class="cls-5" x="360" y="148.27">安心</tspan><tspan x="408" y="148.27">」することができます</tspan><tspan x="0" y="186.27">そして、その「</tspan><tspan class="cls-5" x="168" y="186.27">知識</tspan><tspan x="216" y="186.27">」を「</tspan><tspan class="cls-5" x="288" y="186.27">知恵</tspan><tspan x="336" y="186.27">」に変えることで「勇気」にもなります</tspan></tspan><tspan x="0" y="257">知っておけば得することとは？</tspan><tspan class="cls-16"><tspan x="0" y="300.27">@お家のこと</tspan><tspan x="0" y="338.27">A住宅ローンの仕組み</tspan><tspan x="0" y="376.27">B不動産売買の仕組み</tspan></tspan></text><text class="cls-6" transform="translate(106.39 1269.55)">お家のこと</text><line class="cls-17" y1="1280.05" x2="373.81" y2="1280.05"/><text class="cls-13" transform="translate(36.39 1329.55)">○長期優良住宅<tspan x="0" y="38">　日本の住宅をより長く安心して住めるよう支援するため、平</tspan><tspan class="cls-18" x="504" y="38">成</tspan><tspan x="526.5" y="38">2</tspan><tspan class="cls-18" x="537.68" y="38">1</tspan><tspan x="553.36" y="38">年に長期優良住宅の普及の促進に</tspan><tspan x="0" y="68">　関する法律が制定されました。この法律によって、国が定める一定の基準を満たした住宅を建築計画し</tspan><tspan x="0" y="98">　行政に申請することで様々なメリットが受けられるようになりました</tspan><tspan class="cls-14" x="576" y="98">。</tspan><tspan class="cls-5"><tspan x="0" y="158">　長期優良住宅の基準には</tspan><tspan x="0" y="188">　耐震等級・断熱等級・維持管理・劣化対策　などがあります</tspan><tspan class="cls-14" x="504" y="188">。</tspan></tspan><tspan x="0" y="248">　これらの基準を満たすために、一般的に建築コストがアップしてしまいます</tspan><tspan x="0" y="278">　しかし、長期優良住宅には、長く快適に住むことのできる次のようなメリットがあります</tspan><tspan class="cls-5"><tspan x="0" y="308">　・耐震性能強化による安心の住まい</tspan><tspan x="0" y="338">　・断熱性能アップによる快適性と光熱費の削減</tspan><tspan x="0" y="368">　</tspan><tspan class="cls-19" x="18" y="368">・</tspan><tspan x="31.5" y="368">ＣＯ２排出軽減により環境への負荷を減らせます</tspan><tspan x="0" y="398">　・税制上の優遇措置を受けられます</tspan></tspan><tspan x="0" y="458">〇高気密高断熱住宅</tspan><tspan x="0" y="488">　高断熱高気密住宅とは、壁・床・天井などに断熱材を使って高い断熱性・気密性を実現した住まいの</tspan><tspan x="0" y="518">　ことです。一般的には省エネルギー基準を超える断熱気密レベルを満たしているかどうかが</tspan><tspan class="cls-14" x="756" y="518">、</tspan><tspan x="0" y="548">　高断熱高気密住宅のひとつの目安になります</tspan><tspan class="cls-14" x="378" y="548">。</tspan><tspan x="0" y="608">　高気密高断熱住宅には３つの発想があります</tspan><tspan class="cls-5"><tspan x="0" y="638">　・安心に投資するという発想</tspan><tspan x="0" y="668">　・環境に投資するという発想</tspan><tspan x="0" y="698">　・基準を設けるという発想</tspan></tspan><tspan x="0" y="758">〇低炭素住宅・ゼロエネ住宅</tspan><tspan x="0" y="788">　低酸素住宅とは建物の断熱性能や、設備機器の利用</tspan><tspan class="cls-18" x="432" y="788">で</tspan><tspan x="454.5" y="788">CO</tspan><tspan class="cls-18" x="480.32" y="788">2</tspan><tspan x="496" y="788">排出削減の配慮をしたエコ住宅のことを</tspan><tspan x="0" y="818">　いいます</tspan><tspan class="cls-14" x="90" y="818">。</tspan><tspan x="0" y="848">　ゼロエネ住宅はとは高断熱によ</tspan><tspan class="cls-18" x="270" y="848">る</tspan><tspan x="292.5" y="848">20</tspan><tspan class="cls-18" x="314.86" y="848">%</tspan><tspan x="337.94" y="848">以上の省エネと、太陽光発電等の自家発電設備によ</tspan><tspan class="cls-18" x="751.94" y="848">る</tspan><tspan x="774.44" y="848">80%</tspan><tspan x="0" y="878">　以上の創エネで、実質的に消費エネルギーをゼロに抑える住宅のことを言います</tspan><tspan class="cls-14" x="666" y="878">。</tspan><tspan x="0" y="908">　</tspan><tspan class="cls-5"><tspan x="0" y="938">　光熱費などのランニングコストも抑えることができ、環境への負荷も減らせます</tspan><tspan class="cls-14" x="666" y="938">。</tspan></tspan><tspan x="0" y="998">〇構造別</tspan><tspan x="0" y="1028">　保険料を決定する要素として、建物の「構造級別」や「耐震等級」があり</tspan><tspan x="0" y="1058">　それらの違いにより</tspan><tspan class="cls-5" x="180" y="1058">火災保険や地震保険の保険料にも違いがあります</tspan><tspan class="cls-20" x="576" y="1058">。</tspan><tspan x="0" y="1118">〇補助金制度の利用</tspan><tspan x="0" y="1148">　新築・リフォームともに受けられるさまざまな補助金制度があります</tspan><tspan class="cls-14" x="576" y="1148">。</tspan><tspan x="0" y="1178">　それぞれに受けられる条件があり、その条件をクリアすることで補助金が受け取れます</tspan><tspan class="cls-14" x="720" y="1178">。</tspan><tspan x="0" y="1208">　ただし、申請時期や行政自治体の予算枠については年度により異なります</tspan><tspan class="cls-14" x="612" y="1208">。</tspan><tspan x="0" y="1238">　新築　　　　　　　　　　　　　　　　　　　　　リフォーム　　</tspan><tspan x="0" y="1268">　・地域型住宅グリーン化補助金　　　　　　　　　・長期優良住宅リフォーム</tspan><tspan x="0" y="1298">　・ゼロエネ（ＺＥＨ）住宅補助金　　　　　　　　・耐震改修補助</tspan><tspan x="0" y="1328">　・エネフォーム設置補助金　　　　　　　　　　　・エコリフォーム補助</tspan><tspan x="0" y="1358">　・すまい給付金　　　　　　　　　　　　　　　　・バリアフリー改修補助</tspan><tspan x="0" y="1388">　など各市町村の補助金があります。　　　</tspan></text><image width="400" height="386" transform="translate(36.39 1222.02) scale(0.14)" xlink:href="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAZIAAAGDCAYAAAABCJbEAAAACXBIWXMAAFFaAABRWgHv+C5vAAAgAElEQVR4Xux9B3hcxbn2vf+T0AKBEHJTbgohITQDbjJCzTIlyU3IhZtc0gtpN6EYXNS1Kqtim06AJBCSACH0YrAtaftKsk0vNrbBxja2tLuS3Hsv8883M+/MrJL4bAK2d+WZ53mfszo75+xqz8z3zlfn3xhj/+bg4ODg4PCvwrODg4ODg4PDgeDZwcHBwcHB4UDw7ODg4ODg4HAgeHZwcHBwcHA4EDw7ODg4ODg4HAieHRwcHBwcHA4Ezw4ODg4ODg4HgmcHBwcHBweHA8Gzg4ODg4ODw4Hg2cHBwcHBweFA8Ozg4ODg4OBwIHh2cHBwcHBwOBA8Ozg4ODg4OBwInh0cHBwcHBwOBM8ODg4ODg4OB4JnBwcHBwcHhwPBs4ODg4ODg8OB4NnBwcHBwcHhQPDs4ODg4ODgcCB4dnBwcHBwcDgQPDs4ODg4ODgcCJ4dHBwcHBwcDgTPDg4ODg4ODgeCZwcHBwcHB4cDwbODg4ODg4PDgeDZwcHBwcHB4UDw7ODg4ODg4HAgeHZwcHBwcHA4EDw7OOQWrm1Pjm7oSi2qjSWf2lB74b+XhxJ3VEcTd9XEEg2/fG7lBT9/bvnXvO7h4JApysLJcb9+rvcbZcHe2eWh3rKaaLKjdfaqL/OjryyUbKY+dy9Y/v+87uOQ2/Ds4JD9+MWzK86ko68z2drYndrnn93P/LNXsepIcndNrI81dA0wPrFZTSy5ty6W2lkeTCyeFEhM87qvg8NgTJzZe9nEjp5bq0KJ0ORg4pnKcDLFx9b+hq5+VhtP7vfxscbf20bjrSqc2MSPVV73dMh9eHZwyG6UhwfGcXKIcw2ET+Y+1shRF0sK+DpTgkA4ofBjgtXzv5tmp8SxJtpHE30Zn/xBr89wcJgcSH25PJC4pyqU3FMRSuz3xfuZLz7Ax1aK8b/5WEvyBUuK8XEoQOPO19knxhknnLUTA713/2FR4hSvz3HITXh2cMhe1MQSN9THU1/jk3YLTVxMYkxkOnKyYFwD0ed5fzHpRR+urTTOHqDXi/1z+r/GV5o//WpV5MNen+twZKCua+ATEzp6ruZj6FG+WNmGMUXEUR1J6LFFwHtKE2EV/Bz1o/eIbOq7SUNOPO/1mQ65Cc8ODtkLvgKc19CZ3EmaiJ7IsYQ
